import React,{ useState} from "react";

var MARS = () => {
    const [date,setDate] = useState(null);
    const [page,setPage] = useState(null);
    const [data,setData] = useState(null);
    function handleDate(event){
        setDate(event.target.default)
    }
    function handlePage(event){
        setPage(event.target.default)
    }
    async function getData() {
        const res = await fetch(
          `https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?earth_date=${date}&page=${page}&api_key=m5qSFJLeqz6oshoKMC0S8QChxUfWerz4VdqOiFo8  `
        );
        const dataNew = await res.json();
        setData(dataNew);
        console.log(data);
      }
  return (
    <div class="form-control">
      <div className="flex space-x-3 center">
        <div class="flex inp space-x-2">
          <input
            placeholder="Latitute in float (eg: -95.33)"
            class="w-full input input-primary input-bordered"
            type="text"
            onChange={handleDate}
          />
        </div>
        <div class="flex inp space-x-2">
          <input
            placeholder="Longitude in float (eg: 29.78)"
            class="w-full input input-primary input-bordered"
            type="text"
            onChange={handlePage}
          />
        </div>
          <button class="btn btn-primary">go</button>
      </div>
    </div>
  );
};

export default MARS;
